import React from 'react';
import styles from './ImageBanner.module.scss';

const { container, skydive, kayak, studlagil, hourse } = styles;

const ImageBanner = () => {
  return (
    <div className={container}>
      <div className={skydive} />
      <div className={kayak} />
      <div className={studlagil} />
      <div className={hourse} />
    </div>
  );
};

export default ImageBanner;
